import React from 'react';

const ProfessionalServicesPage = ({ translations }) => {
  const professionalServices = translations.professionalServices;

  return (
    <div className="professional-services">
      <h2>{professionalServices.imageAlt}</h2>
      <img src="/images/professional-services.jpg" alt={professionalServices.imageAlt} />

      <p>{professionalServices.paragraph}</p>

      <h3>{professionalServices.businessSolutionsHeader}</h3>
      <ul>
        {professionalServices.businessSolutionsList.map((solution, index) => (
          <li key={index}>{solution}</li>
        ))}
      </ul>

      <h3>{professionalServices.ourServicesHeader}</h3>
      <ul>
        {professionalServices.ourServicesList.map((service, index) => (
          <li key={index}>{service}</li>
        ))}
      </ul>
    </div>
  );
};

export default ProfessionalServicesPage;
